import React from "react";
import "./Home.css";

export default function Home() {
  return (
    <div className="home-container">
      <div className="greeting">
        <h1 className="animated-text">Welcome to CrackerMart</h1>
      </div>

      <div className="slideshow">
        <div className="slide-track">
          <img src="httjpg" alt="Firework 1" className="slide" />
          <img src="https://i.imgur.com/Xw0idcS.jpg" alt="Firework 2" className="slide" />
          <img src="https://i.imgur.com/7UvGy7G.jpg" alt="Firework 3" className="slide" />
          <img src="https://i.imgur.com/DFKQ42r.jpg" alt="Firework 1" className="slide" />
          <img src="https://i.imgur.com/Xw0idcS.jpg" alt="Firework 2" className="slide" />
        </div>
      </div>

    
    </div>
  );
}
